import React from "react";

const Education = () => {
  return (
    <div id="section-know-me-better" className="education">
      <div className="education-1">
        Bootcamp, Front-end Developer - Adalab Promo M 2021
      </div>
      <div className="education-2">
        Specialization in UI UX Design- California Institute of the Arts, on
        Coursera 2020-2021
      </div>
      <div className="education-3">
        Universidad Complutense- Master in Organizational Psychology 2012-2013
      </div>
      <div className="education-4">
        Universidad Católica Andrés Bello- Lic. in Human Resources 2004-2009
      </div>
    </div>
  );
};

export default Education;
